import React, { useState, setState } from "react";
import ReactDOM from "react-dom";

const [element, setData] = useState({"store": []});

function ping() {
    fetch('../api')
      .then(response => response.text())
      .then(data => {
          setData(data)
        });
}

ping()

ReactDOM.render(
    <div>
        <div>This page was served statically</ div>
        <div>{element}</div>
    </div>,
    document.getElementById('root')
);
